":320,"config_height":320},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/245116585_1085051578746860_6408960488110086774_n.jpg?stp=dst-jpg_e15_s480x480\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=YcM90FDX8rwAX-Pl_K1\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8PZ6O_HXt8yeT_7SREenEPOPXr7NnBwluP0HLJhmWuEw\u0026oe=62BD9387\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/245116585_1085051578746860_6408960488110086774_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=YcM90FDX8rwAX-Pl_K1\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-181FSUb1eT2q-NwRmxy0ud8p1YyADS8_8OAuSZKfAiw\u0026oe=62BD9387\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2668154133841937589","edge_media_to_caption":{"edges":[{"node":{"text":"In 2016, I cried over not winning multiple grants for my PhD research despite tons of applications.\n\nIn 2012, I turned down my admission at IIT Illinois, USA because I did not have money to fund it nor did I have information of who was going to teach me how to apply for the scholarships that will fund it. It is not like now, that there are online courses to teach what isn't taught in schools. \n\nBy the way, I had a good grade; a 4.75/5 distinction in my MSC in environmental chemistry is not \"beans\". \n\nUnlike 2012 where I had a choice, I did not have in 2016 because it meant I would not be able to proceed to the next phase of my PHD. \n\nI DID NOT HAVE A CHOICE. FAILURE WAS NOT AN OPTION. 2016 refusal of admission still haunts me so this time, I had to win a grant to fund the next phase of my PHD research or be stuck or find the money elsewhere. \n\nThat time of my life was trying. 1.5 years straight I was applying and \" failing\" \nHere is what I did not know, I was discovering the secrets to wining global opportunities such as grants, scholarships, and fellowships. \n\nIn 3 years, I discovered there was a \nPathway - I needed to follow to apply and win. \nPattern - in which all these grants \u0026 scholarship questions were asked\nFormula - For answering the same type of questions for different opportunities. \n\nI want to share it with you if you are a youth or professional (20-45) who has ever struggled with finding/winning grants, fellowships, scholarships, or global opportunities that can help you grow your career or self. \n\nHere is the thing, I have tried this same pattern, process, \u0026  pathways with others since 2019 and it has been working. \n\n\u2714\ufe0fYou do not have to have years of experience.\n\u2714\ufe0fYou do not have to know someone who knows someone who is awarding the grants.\n\u2714\ufe0f You do not have to be the most brilliant person. \n\u2714\ufe0f You do not have to run an NGO\n\u2714\ufe0f You do not have to be based in the city\n\u2714\ufe0f You do not have to looks a certain way.\n\nYou just need to KNOW HOW. I have developed a FRAMEWORK THAT WORKS - The \"A-Z of Winning Global Opportunities\" online course is the framework. \n\nGet IN\nSept 22- Oct 1.\n Link in bio. \n\n#grants #grantcoach #scholarship"}}]},"shortcode":"CUHMAxZo4S1","edge_media_to_comment":{"count":1},"taken_at_timestamp":1632288780,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/242380061_337978308013508_1714522969857587888_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=UI6rw_5M6mEAX-8OjAM\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9sXBh0msktdcM2ss9j45C50koNJItfELN6Im4K1T_RsQ\u0026oe=62BD78CB\u0026_nc_sid=4efc9f","edge_liked_by":{"count":13},"edge_media_preview_like":{"count":13},"owner":{"id":"1052004235"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.288