 need push poverty out till it goes extinct?\n\nHere goes the last two targets\ud83d\udc47\n\nTarget 1.A\nEnsure significant mobilization of resources from a variety of sources, including through enhanced development cooperation, in order to provide adequate and predictable means for developing countries, in particular least developed countries, to implement programmes and policies to end poverty in all its dimensions\n\n1.A.1\nProportion of resources allocated by the government directly to poverty reduction programmes\n\n1.A.2\nProportion of total government spending on essential services (education, health and social protection)\n\nTarget 1.B\nCreate sound policy frameworks at the national, regional and international levels, based on pro-poor and gender-sensitive development strategies, to support accelerated investment in poverty eradication actions\n\n1.B.1\nProportion of government recurrent and capital spending to sectors that disproportionately benefit women, the poor and vulnerable groups.\n\nYou are progressing in your knowledge of SDGs and for this, I'm proud.\ud83e\udd29\n\nDo you know you can play a role in eradicating poverty, and such role can grant you access to global opportunities?\nLet me show you how. Click this link to learn more\ud83d\udc47\nhttps://linktr.ee/Itrainafrica\n\n#didyouknow #scholarship #newknowledge #fellowship  #skillshub #skillscoach #onlineschool #womenempowerment #youthempowerment #youthleadership #nigeriangrants #nigerianscholarships #studentloan #lagos #accra #travelgrants #travelabroad #usvisa #lagosevents#globalopportunities\n#nigerianjobs #onlinejobs #abujajobs  #itrainafrica"}}]},"shortcode":"CPPovGHB-wX","edge_media_to_comment":{"count":0},"taken_at_timestamp":1621834857,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/192228171_1051981485338168_2500357415929594443_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108