ud83d\udc49 \"I wasn't expecting to win in a short time since I had just come across I-Train Africa through an Instagram ad in March 2021. I sent them a DM and paid for a course and from that day, my life has changed. Before I made payment for the A-Z of Winning Global Opportunities online course, I had started applying for an UNLEASH program called the UNLEASH Hack. I remember feeling frustrated as I didn't know much about the SDGs and I didn't know what to write but then I found the ad, paid for the cou, use it, and took the bold step after watching Mrs. Aderinsola speak via the video lessons.\n\nIt was a dream come true for me as I always wanted to go global and no one around me understood my ambitions. \n\nI was just a 20-year-old year 1 girl whom they thought was over-ambitious. See where my ambition landed me; on the global stage. \n\nAccess to the UNLEASH community with talents from 167 countries. \n\nThank you Ms. Aderinsola, thank you, I-Train Africa. I can't wait to start the UNLEASH project and put it on my CV \u0026 LinkedIn profile.\n\nFelicia @theskillcoach was a stranger to us 6 weeks ago, today she is a global citizen. \n\nDo not short-change yourself, pay for knowledge and access to the global stage. \n\nTo get started, send us a DM, let's recommend which of our products or services is good for you based on what global opportunity (scholarship, innovation lab, grant, etc) you want to achieve. \n\nOr click the link in bio to view which of them aligns with what you need right now. \n\nIf you don't know what you need, we have a clear online course for that and a one-on-one service too. So we've got you covered. Slide into the DM NOW."}}]},"shortcode":"CPOo17wn9ma","edge_media_to_comment":{"count":1},"taken_at_timestamp":1621801358,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/190083783_320591276121198_870612577407239218_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u00